import React from 'react';
import './tech.css';
import Nav from './Nav';
import tech from '../images/tech.png';


function Tech() {
  return (
    <div className='tech' >
      <Nav/>
      <div className='sec-1'>
          <div class="rainbow-letters">Technology</div>
          <img className='kid-1' src={tech} alt='tech-sticker' />

        </div><br/>
        <div className='sec-2'> 
          <div className='box-1'></div>
          <div className='box-1'></div>
          <div className='box-1'></div>
          <div className='box-1'></div>
        </div><br/>
        
    </div>
  );
}

export default Tech;
